declare var assert: any;
declare var QName: any;
/**
 * Descriptor for an XML attribute
 */
declare class AttributeDescriptor {
    constructor(qname: any, type: any, form: any);
}
/**
 * Descriptor for an XML type
 */
declare class TypeDescriptor {
    constructor(qname: any);
    addElement(element: any): any;
    addAttribute(attribute: any): any;
    add(item: any, isMany: any): void;
    findElement(name: any): any;
    findAttribute(name: any): any;
    find(name: any): any;
}
/**
 * Descriptor for an XML element
 */
declare class ElementDescriptor extends TypeDescriptor {
    constructor(qname: any, type: any, form: any, isMany: any);
    clone(isMany: any): any;
}
